import React from 'react';
import '../../sass/Tela1/tela1.css'

const tela5 = () => {
    console.log('Tela1')
    return(
        <div className='tela--inicial--tela1'>
            <p>Correção das Observações do CRLV-E</p>
            <p>Correção de Chassi</p>
            <p>Correção de Informações do Proprietário</p>
            <p>Correção de Informações do Veículo</p>
            <p>Correção de Município</p>
            <p>Correção de Restrições</p>
        </div>
    )
}

export default tela5
